import './App.css';
import { Chart } from "react-google-charts";

function App() {
  return (
    <div >
      <Chart
        chartType="BarChart"
        data={[["Age", "Weight"], [4, 5.5], [8, 12]]}
        width="100%"
        height="600px"
        legendToggle
        orientation="vertical"
      />
    </div>
  );
}

export default App;
